import React from "react";
import './style.css';

const Icon = props => {
    return (
        <>
            <div className = "icon">
                <a href = "#">Welcome to my blog!</a>
            </div>
            <div>SANYA BANSAL</div>
        </>
    )
}

export default Icon;
